import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <div style={{ padding: '20px', backgroundColor: '#f0f0f0' }}>
        <h1 style={{ color: 'red' }}>Router Test</h1>

        <Routes>
          <Route path="/" element={
            <div>
              <h2>Home Page</h2>
              <p>Basic routing is working</p>
            </div>
          } />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
